	(61,2,'introduction_heading','ABOUT UNION GARDENS'),
	(62,2,'_introduction_heading','field_6560cd7418735'),
	(63,2,'introduction','<p style="text-align: center;">A joint venture between award-winning local home builders, Roffey Homes and Worthing Borough Council, this much anticipated scheme will create a new public realm between Union Place and High Street, reforming the community and breathing life back into an area of the town which has long been neglected.</p>\r\n<p style="text-align: center;">Alongside the four residential blocks will be dedicated commercial space and public and private parking areas, all wrapped around three secluded and landscaped, themed gardens for residents to enjoy. Ingeniously, these lush and beautiful gardens will lie at first floor level on a “podium deck”, sitting above the ground level parking areas, thus establishing an important blend between aesthetics, sustainability and practicality.</p>\r\n<p style="text-align: center;">The apartments themselves have been scrupulously designed, with sustainability and living costs very much in mind. With this ethos, owners can additionally expect to find that the buildings have an improved thermal fabric, sustainable heating systems, underfloor heating, low water usage and biodiverse roofs.</p>\r\n<p style="text-align: center;">Construction is due to commence in Summer 2024 with phased completions anticipated between 2026 and 2027. We invite prospective home buyers to express interest via the form at the bottom of this page, so we can keep you updated as this exciting project gathers momentum.</p>'),
